import React, { useState, useEffect } from 'react';
import { FileText, Upload, MessageSquare, PenTool, UserPlus, Bell, ExternalLink } from 'lucide-react';
import { PieChart, Pie, Cell, BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer } from 'recharts';
import DashboardLayout from '../components/layout/DashboardLayout';
import { getDashboardOverview, getDocumentStatus, getWeeklyUploads, markNotificationAsRead } from '../services/dashboardService';
import { useNavigate } from 'react-router-dom';

const Dashboard = () => {
  const navigate = useNavigate();
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [dashboardData, setDashboardData] = useState({
    stats: {
      totalDocuments: 0,
      reviewedDocuments: 0,
      pendingDocuments: 0,
      needsEditsDocuments: 0
    },
    recentDocuments: [],
    weeklyUploads: [],
    notifications: []
  });

  useEffect(() => {
    const fetchDashboardData = async () => {
      try {
        setLoading(true);
        const [overview, statusData, weeklyData] = await Promise.all([
          getDashboardOverview(),
          getDocumentStatus(),
          getWeeklyUploads()
        ]);

        setDashboardData({
          ...overview,
          documentStatus: statusData,
          weeklyUploads: weeklyData
        });
      } catch (err) {
        setError(err.message);
      } finally {
        setLoading(false);
      }
    };

    fetchDashboardData();
  }, []);

  const handleNotificationClick = async (notification) => {
    try {
      await markNotificationAsRead(notification._id);
      if (notification.document) {
        navigate(`/documents/${notification.document._id}`);
      }
    } catch (err) {
      console.error('Error marking notification as read:', err);
    }
  };

  const quickActions = [
    {
      title: 'Upload New Document',
      icon: Upload,
      description: 'Add a new legal document',
      onClick: () => navigate('/documents/new')
    },
    {
      title: 'Request Legal Feedback',
      icon: MessageSquare,
      description: 'Get expert review',
      onClick: () => navigate('/documents?tab=review')
    },
    {
      title: 'Add Annotation',
      icon: PenTool,
      description: 'Add notes to documents',
      onClick: () => navigate('/documents?tab=annotate')
    },
    {
      title: 'Invite Lawyer',
      icon: UserPlus,
      description: 'Collaborate with legal experts',
      onClick: () => navigate('/team/invite')
    }
  ];

  if (loading) {
    return (
      <DashboardLayout>
        <div className="flex items-center justify-center min-h-screen">
          <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-primary"></div>
        </div>
      </DashboardLayout>
    );
  }

  if (error) {
    return (
      <DashboardLayout>
        <div className="flex items-center justify-center min-h-screen">
          <div className="text-red-500">Error: {error}</div>
        </div>
      </DashboardLayout>
    );
  }

  return (
    <DashboardLayout>
      {/* Welcome Section */}
      <div className="bg-white rounded-xl border border-gray-200 p-6 mb-6 shadow-sm">
        <h1 className="text-3xl font-bold text-gray-900 mb-2">
          Welcome back, {dashboardData.user?.name || 'User'} ðŸ‘‹
        </h1>
        <p className="text-gray-600">
          Here's your legal workspace for collaboration.
        </p>
      </div>

      <div className="grid grid-cols-1 lg:grid-cols-3 gap-6">
        {/* Recent Documents */}
        <div className="lg:col-span-2">
          <div className="bg-white rounded-xl border border-gray-200 overflow-hidden shadow-sm">
            <div className="p-6 border-b border-gray-200">
              <h2 className="text-xl font-semibold text-gray-900">Recent Documents</h2>
            </div>
            <div className="divide-y divide-gray-200">
              {dashboardData.recentDocuments.map((doc) => (
                <div key={doc._id} className="p-6 hover:bg-gray-50 transition-colors">
                  <div className="flex items-center justify-between">
                    <div className="flex items-center gap-4">
                      <div className="w-10 h-10 rounded-lg bg-primary/10 flex items-center justify-center">
                        <FileText className="w-5 h-5 text-primary" />
                      </div>
                      <div>
                        <h3 className="text-base font-medium text-gray-900">{doc.name}</h3>
                        <p className="text-sm text-gray-600">
                          {new Date(doc.updatedAt).toLocaleDateString()}
                        </p>
                      </div>
                    </div>
                    <div className="flex items-center gap-4">
                      <span className={`inline-flex items-center px-3 py-1 rounded-full text-sm font-medium ${
                        doc.status === 'Reviewed' 
                          ? 'bg-green-100 text-green-800'
                          : doc.status === 'Pending Review'
                          ? 'bg-blue-100 text-blue-800'
                          : 'bg-yellow-100 text-yellow-800'
                      }`}>
                        {doc.status}
                      </span>
                      <button 
                        onClick={() => navigate(`/documents/${doc._id}`)}
                        className="flex items-center gap-2 px-4 py-2 rounded-lg bg-primary text-white hover:bg-primary/90 transition-colors"
                      >
                        <ExternalLink className="w-4 h-4" />
                        <span>Open</span>
                      </button>
                    </div>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>

        {/* Quick Actions */}
        <div className="lg:col-span-1">
          <div className="bg-white rounded-xl border border-gray-200 p-6 shadow-sm">
            <h2 className="text-xl font-semibold text-gray-900 mb-4">Quick Actions</h2>
            <div className="grid grid-cols-1 gap-4">
              {quickActions.map((action, index) => (
                <button
                  key={index}
                  onClick={action.onClick}
                  className="flex items-center gap-4 p-4 rounded-lg border border-gray-200 hover:border-primary/20 hover:shadow-lg transition-all text-left"
                >
                  <div className="w-10 h-10 rounded-lg bg-primary/10 flex items-center justify-center">
                    <action.icon className="w-5 h-5 text-primary" />
                  </div>
                  <div>
                    <span className="text-base font-medium text-gray-900">{action.title}</span>
                    <p className="text-sm text-gray-600">{action.description}</p>
                  </div>
                </button>
              ))}
            </div>
          </div>
        </div>

        {/* Insights Panel */}
        <div className="lg:col-span-2">
          <div className="bg-white rounded-xl border border-gray-200 p-6 shadow-sm">
            <h2 className="text-xl font-semibold text-gray-900 mb-6">Insights</h2>
            <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
              {/* Document Status Chart */}
              <div>
                <h3 className="text-base font-medium text-gray-900 mb-4">Documents by Status</h3>
                <div className="h-[200px]">
                  <ResponsiveContainer width="100%" height="100%">
                    <PieChart>
                      <Pie
                        data={dashboardData.documentStatus}
                        cx="50%"
                        cy="50%"
                        innerRadius={60}
                        outerRadius={80}
                        paddingAngle={5}
                        dataKey="count"
                        nameKey="_id"
                      >
                        {dashboardData.documentStatus.map((entry, index) => (
                          <Cell 
                            key={`cell-${index}`} 
                            fill={
                              entry._id === 'Reviewed' ? '#10b981' :
                              entry._id === 'Pending Review' ? '#1e3a8a' :
                              '#6b7280'
                            } 
                          />
                        ))}
                      </Pie>
                      <Tooltip />
                    </PieChart>
                  </ResponsiveContainer>
                </div>
                <div className="flex justify-center gap-4 mt-4">
                  {dashboardData.documentStatus.map((item, index) => (
                    <div key={index} className="flex items-center gap-2">
                      <div 
                        className="w-3 h-3 rounded-full" 
                        style={{ 
                          backgroundColor: 
                            item._id === 'Reviewed' ? '#10b981' :
                            item._id === 'Pending Review' ? '#1e3a8a' :
                            '#6b7280'
                        }} 
                      />
                      <span className="text-sm text-gray-600">{item._id}</span>
                    </div>
                  ))}
                </div>
              </div>

              {/* Weekly Uploads Chart */}
              <div>
                <h3 className="text-base font-medium text-gray-900 mb-4">Weekly Uploads</h3>
                <div className="h-[200px]">
                  <ResponsiveContainer width="100%" height="100%">
                    <BarChart data={dashboardData.weeklyUploads}>
                      <CartesianGrid strokeDasharray="3 3" />
                      <XAxis dataKey="_id" />
                      <YAxis />
                      <Tooltip />
                      <Bar dataKey="count" fill="#1e3a8a" />
                    </BarChart>
                  </ResponsiveContainer>
                </div>
              </div>
            </div>
          </div>
        </div>

        {/* Notifications */}
        <div className="lg:col-span-1">
          <div className="bg-white rounded-xl border border-gray-200 overflow-hidden shadow-sm">
            <div className="p-6 border-b border-gray-200">
              <h2 className="text-xl font-semibold text-gray-900">Notifications</h2>
            </div>
            <div className="divide-y divide-gray-200">
              {dashboardData.notifications.map((notification) => (
                <div 
                  key={notification._id} 
                  className="p-6 hover:bg-gray-50 transition-colors cursor-pointer"
                  onClick={() => handleNotificationClick(notification)}
                >
                  <div className="flex items-start gap-4">
                    <div className="w-10 h-10 rounded-lg bg-primary/10 flex items-center justify-center">
                      <Bell className="w-5 h-5 text-primary" />
                    </div>
                    <div>
                      <p className="text-sm text-gray-900">{notification.message}</p>
                      <p className="text-xs text-gray-500 mt-1">
                        {new Date(notification.createdAt).toLocaleDateString()}
                      </p>
                    </div>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>
    </DashboardLayout>
  );
};

export default Dashboard;
